import React from 'react'
import "@fontsource/quantico";
function Homepage() {
  return (
    <div className='flex w-screen h-screen bg-[#160923]'>
        <div className='flex flex-row w-full justify-center items-center'>
            <div className='w-1/3 border-2 h-96 rounded-xl flex flex-col'>
            <div className='h-1/2 text-white uppercase text-4xl text-left pl-4 mt-8'>WELCOME TO THE YEARBOOK PORTAL 23 OF IIT INDORE ...</div>
            <div className='h-1/2 text-white uppercase text-xl tex-left pl-4 mt-4'>ALUMNI CELL, IIT INDORE 
................................................................................................................................................................................................</div>
            </div>
        </div>
    </div>
  )
}

export default Homepage
